import React, { Component } from 'react'
import PetService from '../services/pet-service'


export class Adopt extends Component {
  state = {
    cats:[],
    dogs:[],
    people:[]
  }

  componentDidMount (){
    // async call
    PetService.getAllCats()
    .then(cats => {
      console.log(cats)
      this.setState({ cats });
    }).then(
      PetService.getAllDogs()
      .then(dogs => {
        this.setState({dogs});
      })
    )
    .catch(e => console.log(e));
  }

  render() {
    return (
      <div>
        <h2>Cats</h2>
